import React, { useState } from 'react';
import './App.css'; // Ensure you have styles here

function App() {

	const [backgroundColor, setBackgroundColor] = useState(`brown`);

	const radius = 350
	const centerRadius = 25
	const hourLen = radius * 0.5
	const minLen = radius * 0.75

	const width = window.innerWidth
	const height = window.innerHeight

	return (
        <div style={{ position: `relative`, textAlign: `center`, marginTop: `60px` }}>
            <div
                style={{ // CLOCK
                    width: `${2 * radius}px`,
                    height: `${2 * radius}px`,
                    backgroundColor: `tan`,
                    borderRadius: `50%`,
                    border: `10px solid black`,
                    position: `absolute`,
                    //transform: `translateY(-50px)`,
                    top: `0px`,
                }}
            />

            <div
                style={{ // CLOCK CENTER
                    width: `${2 * centerRadius}px`,
                    height: `${2 * centerRadius}px`,
                    backgroundColor: `black`,
                    borderRadius: `50%`,
                    position: `absolute`,
                    top: `${radius - centerRadius}px`,
                    left: `${radius - centerRadius}px`,
                }}
            />

            <div
                style={{ // HOUR HAND
                    width: `15px`,
                    height: `${hourLen}px`,
                    backgroundColor: `black`,
                    borderRadius: `4px`,
                    position: `absolute`,
                    top: `${(radius - minLen)/2}px`,
                    left: `${(radius - minLen)/2}px`,
                }}
            />
        </div>
	);
}

export default App;
